class Solution(object):

    def shortestDistance(self, maze, start, destination):
        """
        :type maze: List[List[int]]
        :type start: List[int]
        :type destination: List[int]
        :rtype: int
        """
        import heapq
        m, n = len(maze), len(maze[0])
        visited = set()
        q = []
        destination = tuple(destination)
        heapq.heappush(q, (0, tuple(start)))

        def visit(dis, p, d):
            # 0 uo 1 down 2 left 3 right
            i, j = p
            if d == 0:
                while i - 1 >= 0 and maze[i - 1][j] != 1:
                    i -= 1
                    dis += 1
            if d == 1:
                while i + 1 < m and maze[i + 1][j] != 1:
                    i += 1
                    dis += 1
            if d == 2:
                while j - 1 >= 0 and maze[i][j - 1] != 1:
                    j -= 1
                    dis += 1
            if d == 3:
                while j + 1 < n and maze[i][j + 1] != 1:
                    j += 1
                    dis += 1
            if (i, j) not in visited:
                heapq.heappush(q, (dis, (i, j)))

        while q:
            dis, p = heapq.heappop(q)
            visited.add(p)
            if p == destination:
                return dis
            for d in xrange(4):
                visit(dis, p, d)

        return -1


